import React, { useState } from "react";
import MenuItem from "../MenuItem/MenuItem";
import classes from "./MenuItemList.module.css"

const MenuItemList = (props) => {

    let ulClasses = '';

    if (props.menuData.type == 'header-menu') {
        ulClasses += ' ' + classes.headerMenu;
        console.log(props.menuData.type)
    }

    return(
        <ul className={ulClasses}>
            {1/* {props.menuData.names.map((output, id) => {
                <MenuItem type={props.menuData.type} name={output} key={id}/>
            })} */}
        </ul>
    )

}

export default MenuItemList;
